import { Route } from '@angular/router';
import { ExpensesComponent } from './';

export const EXPENSES_ROUTES: Route[] = [
  {
    path: '',
    // component: ExpensesComponent,
    oadComponent: () => import('./pages/home').then((m) => m.HomeComponent)
  },
  // {
